import Head from 'next/head';

const Layout = () => (
    <div>
        <Head>
            <title>UAV UI</title>
            
            <link rel="stylesheet" href="https://maxcdn.bootstrapcdn.com/bootstrap/4.0.0-alpha.6/css/bootstrap.min.css" />
            <link rel="stylesheet" href="../styles/styles.css"/>       
        </Head>
    </div>
);

export default Layout;
